import React from 'react';


const Footer = () => {
    return (
        <footer>
            <div>
                <img src='/image/insta.jpg' />
                <img src='/image/in.PNG' />
                <img src='/image/mail.PNG' />
            </div>
            <h6>Rodiyah@2024</h6>
        </footer>
    );
};
export default Footer;
